	add("chief", "{\"term\":\"chief\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027chief\u0027 (lang\u003dfro) from \u0027capum\u0027 (lang\u003dla) (from which also \u0027captain\u0027 \u0027chieftain\u0027 , from Latin \u0027caput\u0027 (lang\u003dla) (English \u0027cap\u0027 (head covering) , from Proto-indo-european {{m|ine-pro|*kauput-}} (English \u0027head\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A leader or head of a group of people, organisation, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Nelson Mandela, \u0027Long Walk to Freedom\u0027, Abacus 2010, p. 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My father, Gadla Henry Mphakanyiswa, was a \u0027\u0027chief\u0027\u0027 by both blood and custom\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The top part of a shield or escutcheon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1889\u0027\u0027, Charles Norton Elvin, \u0027A Dictionary of Heraldry\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"When the \u0027\u0027Chief\u0027\u0027 is Charged with any figure, in blazon it is said to be \u0026quot;\u0027On a \u0027\u0027Chief\u0027\u0027\u0027\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A head officer in a department, organization etc.; a boss\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"All firefighters report to the fire \u0027\u0027chief\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An informal address to an equal\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Hey, chief\", \"priority\":10}]}, \"synonyms\":{}}");

