	add("chiffonier", "{\"term\":\"chiffonier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027chiffonnier\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tall, elegant chest of drawers, often with a mirror attached\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dHe looked round the poor room, at the distempered walls, and the bad engravings in meretricious frames, the crinkly paper and wax flowers on the \u0027\u0027chiffonier\u0027\u0027; and he thought of a room like Father Bryan\u0027s, with panelling, with cut glass, with tulips in silver pots, such a room as he had hoped to have for his own\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1936\u0027\u0027, \u0027\u0027, Faber \u0026amp; Faber 2007, p. 71\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"From the half-open drawers of this \u0027\u0027chiffonnier\u0027\u0027 hung laces, ribands, stockings, ladies\u0027 underclothing and an abdominal brace, which gave the impression that the feminine finery had suffered venery\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One who gathers rags and odds and ends; a ragpicker\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A receptacle for rags or shreds\", \"priority\":6}]}, \"synonyms\":{}}");

