	add("children", "{\"term\":\"children\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027children\u0027 alteration of earlier \u0027childre\u0027 {{gloss|\u0026quot;children\u0026quot;; \u0026gt; English dialectal \u0027childer\u0027 }, from Old english (ca. 450-1100) {{m|ang|ċildru}}, {{m|ang|ċildra||children}}, nominative and accusative plural of {{m|ang|ċild||child}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d7|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003d‘\u0027\u0027Children\u0027\u0027 crawled over each other like little grey worms in the gutters,’ he said. ‘The only red things about them were their buttocks and they were raw. Their faces looked as if snails had slimed on them and their mothers were like great sick beasts whose byres had never been cleared.\u0026amp;nbsp;[…]’\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d1|page\u003d18|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/jun/07/obama-apple-google-facebook-tainted-prism Obama\u0027s once hip brand is now passage\u003dNow we are liberal with our innermost secrets, spraying them into the public ether with a generosity our forebears could not have imagined. Where we once sent love letters in a sealed envelope, or stuck photographs of our \u0027\u0027children\u0027\u0027 in a family album, now such private material is despatched to servers and clouds operated by people we don\u0027t know and will never meet\", \"priority\":2}]}, \"synonyms\":{}}");

	add("childrenswear", "{\"term\":\"childrenswear\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|children|wear|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"clothing for children\", \"priority\":1}]}, \"synonyms\":{}}");

	add("childship", "{\"term\":\"childship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|child|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or relation of being a child\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Why should any man then doubt of his \u0027\u0027childship\u0027\u0027, doubt of his own everlasting condition, and say, that he is none of the child of God because he is tempted\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chileanism", "{\"term\":\"chileanism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* {{suffix|Chilean|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A term or linguistic feature originating from or specific to the Chilean variety of the Spanish language\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Chinanga\u0027 is, according to Román\u0027s \u0027Diccionario de chilenismos\u0027, not so much a \u0027\u0027Chileanism\u0027\u0027 as an Americanism, since he credits it to Chile, Perú and Ecuador: it is equivalent to the Spanish \u0027taberna\u0027, but enlivened with song and dance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The verb \u0027pechar\u0027 is a \u0027\u0027Chileanism\u0027\u0027 derived from \u0027pecho\u0027, or chest, and means to employ much effort to accomplish a particular goal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Curco\u0027 is a \u0027\u0027Chileanism\u0027\u0027, meaning literally to be bent over with an irritating burden\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Chilean nationalism\", \"priority\":5}]}, \"synonyms\":{}}");

	add("chiliad", "{\"term\":\"chiliad\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|chilia|ad|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a group of 1000 thing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a period of 1000 years; a millennium\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chiliagon", "{\"term\":\"chiliagon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Greek χιλιαγωνος, from χίλιοι ‘thousand’ + γωνία ‘angle’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"rare\u0027) A polygon with a thousand vertices and a thousand edges\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027: If Kant\u0027s claim is just that it is impossible to have a sensory experience of the absence of space, then by contrast it is not impossible to have a sensory experience of a \u0027\u0027chiliagon\u0027\u0027. — Lorne Falkenstein, \u0027Kant\u0027s Intuitionism\u0027 (Toronto 2004, p. 198\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chiliahedron", "{\"term\":\"chiliahedron\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A polyhedron bounded by a thousand plane surfaces\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chiliasm", "{\"term\":\"chiliasm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027χιλιασμός\u0027 () from \u0027χίλιοι\u0027 (thousand)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Belief in an earthly thousand-year period of peace and prosperity, sometimes equated with the return of Jesus for that period\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, Gershom Gerhard Scholem (translated by R. J. Zwi Werblowsky), \u0027Sabbatai Sevi: The Mystical Messiah, 1626-1676‎\u0027, page 10\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was, however, in the Puritan movement in England, and in similar movements on the continent — especially the Bohemian Brethren — that \u0027\u0027chiliasm\u0027\u0027 asserted its greatest vitality as an historical force\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Colin Loader, \u0027The Intellectual Development of Karl Mannheim\u0027, page 10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One of them, bureaucratic conservatism, represented the routinized sphere of administration, whereas the other, \u0027\u0027chiliasm\u0027\u0027, gave rise to the utopian consciousness and modern politics\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Detlef Garbe, \u0027Between Resistance and Martyrdom: Jehovah\u0027s Witnesses in the Third Reich‎\u0027, page 4\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It is a known fact that Bolshevism has unmistakable characteristics of apocalyptic \u0027\u0027chiliasm\u0027\u0027, albeit misinterpreted in a physical, earthly way\", \"priority\":7}]}, \"synonyms\":{}}");

	add("chilliness", "{\"term\":\"chilliness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chilly|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or sensation of being chilly; a disagreeable sensation of coldness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chills", "{\"term\":\"chills\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feeling of being cold, a symptom of many conditions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chillun", "{\"term\":\"chillun\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Spelling representing a Black or Southern U.S. pronunciation of children.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"child\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chilver", "{\"term\":\"chilver\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027cilfor\u0027 (or \u0027ceolfor\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female lamb\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chimp", "{\"term\":\"chimp\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027chimps\u0027\u0027 in the zoo were making a racket\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chimere", "{\"term\":\"chimere\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027chimarre\u0027 from Spanish \u0027zamarra\u0027 Cognate with French \u0027chamarre\u0027 \u0027simarre\u0027 Italian \u0027zimarra\u0027 of same origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The upper robe worn by some bishops of the Anglican communion, usually without sleeves\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chimney", "{\"term\":\"chimney\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{borrowing|fro|cheminee|lang\u003den}}, from Latin {{m|la|caminus}}, from Ancient greek (to 1453) {{m|grc|κάμινος||furnace}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vertical tube or hollow column used to emit environmentally polluting gaseous and solid matter (including but not limited to by-products of burning carbon or hydro-carbon based fuels); a flue\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1883:\u0027\u0027 w:Robert Louis Robert Louis Stevenson, \u0027w:Treasure Treasure Island\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Our \u0027\u0027chimney\u0027\u0027 was a square hole in the roof: it was but a little part of the smoke that found its way out, and the rest eddied about the house, and kept us coughing and piping the eye\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The glass flue surrounding the flame of an oil lamp\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The smokestack of a steam locomotive\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A narrow cleft in a rock face; a narrow vertical cave passage\", \"priority\":6}]}, \"synonyms\":{}}");

	add("chimpanzee", "{\"term\":\"chimpanzee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"The first recorded use of the name \u0027chimpanzee\u0027 dates to 1738. The name is derived from an unspecified Bantu language of Angola, comparable to Vili (Civili, Zone H) \u0027ci-mpenzi\u0027 \u0026lt;ref\u0026gt;\u0026quot;chimpanzee\u0026quot; in American Heritage Dictionary of the English Language, Fifth Edition, Houghton Mifflin Harcourt Publishing Company, 2011.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A great ape of the genus \u0027Pan\u0027, native to Africa, and believed by biologists to be the closest extant relative to humans\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chinaman", "{\"term\":\"chinaman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Chinese Pidgin English. A calque of Chinese \u0027中國人\u0027 {{suffix|China|man|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who is Chinese\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1872\u0027\u0027, w:Mark Mark Twain, \u0027w:Roughing Roughing It\u0027, 2007, [http://books.google.com.au/books?id\u003dgjUOvGeK51MC\u0026amp;pg\u003dPA169\u0026amp;dq\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dH-rpUv3zHoSCkQWs3oGIBg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;f\u003dfalse page 169\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A disorderly \u0027\u0027Chinaman\u0027\u0027 is rare, and a lazy one does not exist. So long as a \u0027\u0027Chinaman\u0027\u0027 has strength to use his hands he needs no support from anybody; white men often complain of want of work, but a \u0027\u0027Chinaman\u0027\u0027 offers no such complaint; he always manages to find something to do.Any white man can swear a \u0027\u0027Chinaman’s\u0027\u0027 life away in the courts, but no \u0027\u0027Chinaman\u0027\u0027 can testify against a white man\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1906\u0027\u0027, Hubert D. Russell (editor), \u0027Complete Story of the San Francisco Horror, 1906\u0027, 2003, [http://books.google.com.au/books?id\u003drV0vQgaH_eQC\u0026amp;pg\u003dPA251\u0026amp;dq\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dH-rpUv3zHoSCkQWs3oGIBg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;f\u003dfalse page 251\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Another favorite pastime of the Highbinder who is usually a loafer, is to levy blackmail on a wealthy \u0027\u0027Chinaman\u0027\u0027.If it were not that the \u0027\u0027Chinamen\u0027\u0027 kill only men of their own race and let alone all other men, the citizens of San Francisco would have sacked and burned Chinatown\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1941\u0027\u0027, George Ade, \u0027Stories of the Streets and of the Town: From the Chicago Record 1893 - 1900\u0027, reprinted as \u0027\u00272003\u0027\u0027, \u0027Stories of Chicago\u0027, [http://books.google.com.au/books?id\u003diERot8PUEkoC\u0026amp;pg\u003dPA163\u0026amp;dq\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dH-rpUv3zHoSCkQWs3oGIBg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Chinaman%22%7C%22Chinamen%22\u0026amp;f\u003dfalse page 163\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In Clark Street, where all the nations of the earth dwell together in harmony, one has but to go downstairs to find a \u0027\u0027Chinaman\u0027\u0027. And when found he is washing\", \"priority\":10}]}, \"synonyms\":{}}");

	add("chinatown", "{\"term\":\"chinatown\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|China|town|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A district of a city or town (in a country other than China) in which there is a large concentration of Chinese residents and businesses\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chinlone", "{\"term\":\"chinlone\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Burmese\"], \"text\":\"From Burmese {{m|my|ခြင်းလုံး}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Burmese ball game incorporating aspects of both sport and dance\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chintz", "{\"term\":\"chintz\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hindi\"], \"text\":\"From Hindi \u0027छींट\u0027 (chīṅṭ).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A painted or stained calico fabric, originally produced in India, and known for its brightly colored designs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a meerschaum pipe and a jar half-full of wasps and apricot jam. He found some glasses which didn\u0027t look very clean and polished them on a \u0027\u0027chintz\u0027\u0027 window curtain\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chipboard", "{\"term\":\"chipboard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chip|board|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A building material made from wood chips compressed and bound with synthetic resin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chipmaker", "{\"term\":\"chipmaker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chip|maker|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A company that manufactures integrated circuit chips\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chipotle", "{\"term\":\"chipotle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"classical nahuatl\"], \"text\":\"From Spanish {{m|es|chipotle}}, from Classical nahuatl {{m|nci|chīlli||pepper}} + {{m|nci|pōctli||smoke}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A ripe jalapeño pepper, dried and smoked for use in cooking\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chipset", "{\"term\":\"chipset\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chip|set|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of integrated circuits (\u0026quot;chips\u0026quot;) that are designed to work together, and are usually marketed as a single product\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chirp", "{\"term\":\"chirp\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short, sharp or high note or noise, as of a bird or insect\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A pulse of signal whose frequency sweeps through a band of frequencies for the duration of the pulse\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chirality", "{\"term\":\"chirality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|chiral|ity|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The phenomenon, in chemistry, physics and mathematics, in which objects are mirror images of each other, but are not identical\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chirography", "{\"term\":\"chirography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|chiro|graphy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"calligraphy or penmanshi\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1856\u0027\u0027, Edward Parrish, \u0027An Introduction to practical pharmacy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A flourishing style of \u0027\u0027chirography\u0027\u0027 is nowhere less in place than on a physician\u0027s prescription\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The art of telling fortunes by examining the hand\", \"priority\":4}]}, \"synonyms\":{}}");

	add("chiropody", "{\"term\":\"chiropody\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|chiro|t1\u003dhand|pody|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of medicine concerned with the diagnosis and treatment of diseases of the feet (and formerly the hands\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chiropractor", "{\"term\":\"chiropractor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027χείρ\u0027 (hand) + \u0027πρᾶξις\u0027 (action, activity, practice)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A health care practitioner who specializes in chiropractic, the hands on or hand-held instrumental movement of the bone structure of the body to improve the function of the joints and/or nervous system\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chiropterologist", "{\"term\":\"chiropterologist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027chiroptera\u0027 {{suffix||logist|alt2\u003dologist|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who studies bats (the flying mammals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, w:Kathleen Kathleen Meyer, \u0027Barefoot Hearted: A Wild Life Among Wildlife\u0027, Villard (2001), ISBN 9780375504389, page 88\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Several years later, after reading three of his books on bats, I placed a call to the venerable \u0027\u0027chiropterologist\u0027\u0027 Dr. M. Brock Fenton, known as the \u0026quot;batman\u0026quot; of York University in Toronto\", \"priority\":3}]}, \"synonyms\":{}}");

	add("chirplet", "{\"term\":\"chirplet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chirp|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A little chir\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A wavelet whose frequency rises or falls at a constant rate\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chirren", "{\"term\":\"chirren\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Spelling representing a Black or Southern U.S. pronunciation of children.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"child\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chirurgeon", "{\"term\":\"chirurgeon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) {{m|fro|surgien}}, later respelled to more closely match the Latin {{m|la|chīrurgia}}. More at {{l|en|surgeon}}, {{l|en|surgery}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A doctor or surgeon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1664\u0027\u0027, w:Samuel Samuel Pepys, \u0027s:Diary of Samuel Diary of Samuel Pepys\u0027, January\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At noon to the \u0027Change, and there long, and from thence by appointment took Luellin, Mount, and W. Symons, and Mr. Pierce, the \u0027\u0027chirurgeon\u0027\u0027, home to dinner with me and were merry\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1688\u0027\u0027, w:Aphra Aphra Behn, Oroonoko, The Royal Slave\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"All we could do could get no more words from him; and we took care to have him put immediately into a healing bath, to rid him of his pepper, and ordered a \u0027\u0027chirurgeon\u0027\u0027 to anoint him with healing balm, which he suffered, and in some time he began to be able to walk and eat\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1850\u0027\u0027, William Harrison Ainsworth, George Cruikshank, \u0026amp; Hablot Knight Browne, \u0027[http://books.google.com/books?id\u003dhDoFAAAAQAAJ\u0026amp;pg\u003dPA481\u0026amp;dq\u003dchirurgeon Ainsworth\u0027s Magazine]\u0027, p. 481\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"On the following day, Tresham was seized with a sudden illness, and making known his symptoms to Ipgreve, the \u0027\u0027chirurgeon\u0027\u0027 who attended the prison was sent for, and on seeing him pronounced him dangerously ill, though he was at a loss to explain the nature of his disorder\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1889\u0027\u0027, w:Arthur Conan Arthur Conan Doyle, \u0027s:Micah Micah Clarke\u0027, chapter XXX\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Noting that there was something amiss, he had hurried down for a skilled \u0027\u0027chirurgeon\u0027\u0027, whom he brought out to us under an escort of scythesmen\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1893\u0027\u0027, w:Julia Taft Julia Taft Bayne, \u0027s:Molly Molly Webster\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Ye healthful Potions ye \u0027\u0027Chirurgeon\u0027\u0027 sends from ye gallipots Power out,\u0026lt;br/\u0026gt;Ye bedd vpheaues, ye homs is shaken, \u0026amp; ye stooles are hvrl\u0027d aboute\", \"priority\":11}]}, \"synonyms\":{}}");

	add("chirurgery", "{\"term\":\"chirurgery\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027cirurgerie\u0027. Compare \u0027surgery\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Surgery\", \"priority\":1}]}, \"synonyms\":{}}");

